script: |
  super -f text -I q11010.spq | sort > q11010.out

inputs:
  - name: q11010.spq
    data: |
      SELECT - col0 + + col1 / + col1 + col1 + - col1 - - 9 FROM tab2 (FORMAT parquet) WHERE NOT + - col1 * + col0 * col0 * col2 IN ( - ( + - col2 ), col1 );
  - name: tab2

outputs:
  - name: q11010.out
    data: |
      -36
      -54
      -65
